import React,{useState} from "react";
import { Button } from "@mui/material";
import { useSelector, useDispatch } from "react-redux";
import { AiFillDelete, AiFillEdit } from "react-icons/ai";
import { FcPlus } from "react-icons/fc";
const Projectshow = () => {
  const data = useSelector((state) => state.rootReducer.data);
  const [name,setname]=useState();

  return (
    <div>
      <br />
      <h1 style={{ color: "white" }}>Projects</h1>
      <div className="box">
        <br />
        <h2>Projects</h2>
        <br />
        <div className="box2">
          <input
            type={"text"}
            placeholder="Enter Project Name"
            className="bold"
            value={name}
            onChange={(e)=>setname(e.target.value)}

          />
          &nbsp;&nbsp;
          <Button variant="contained" color="warning" onClick={()=>dispatch()}>
            Save
          </Button>
          <br />
          <br />
          <hr />
          <div className="over">
            {data.map((value, index) => {
              return (
                <div key={index} className="prj">
                  {value.name}
                  <AiFillEdit style={{ marginLeft: "50%" }} onClick={()=>setname(value.name)}/>
                  <AiFillDelete style={{ color: "red", marginLeft: "5%" }} />
                </div>
              );
            })}
            <input type="text" id="position" placeholder="Add A Project Name"/>
            <FcPlus id="fix"/>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Projectshow;
